library UQ112x112 {
    uint224 constant Q112 = 2**112;

    // encode a uint112 as a UQ112x112
    function encode(uint112 y) internal pure returns (uint224 z) {
        z = uint224(y) * Q112; // never overflows
    }

    // divide a UQ112x112 by a uint112, returning a UQ112x112
    function uqdiv(uint224 x, uint112 y) internal pure returns (uint224 z) {
        z = x / uint224(y);
    }
}

contract UPToken is ERC20,Ownable{
    using UQ112x112 for uint224;

    IUniswapV2Router02 public  uniswapV2Router;
    address public  immutable USDT;
    IUniswapV2Pair public  uuPair;
    uint256 public lastUpPriceDay;
    bool public openTrading;
    uint256[] public twapTimes;
    uint256[] public usdtPriceCumulatives;
    mapping (uint256 => uint256) public usdtPrices;
    mapping (address => bool) public isBlackListed;
    mapping(address => bool) public whitelisted;

    
    event DestroyedBlackFunds(address _blackListedUser, uint _balance);

    event AddedBlackList(address _user);

    event RemovedBlackList(address _user);

    constructor(address _router, address _usdt) ERC20("Unitiy Pool Token", "UP"){
        uniswapV2Router = IUniswapV2Router02(_router);
        USDT = _usdt;
        uuPair = IUniswapV2Pair( IUniswapV2Factory(uniswapV2Router.factory())
            .createPair(address(this), _usdt) );

        _mint(msg.sender, 1_000_000_000 * 10 ** decimals());
        openTrading = false;
    }

    function decimals() public pure override returns (uint8){
        return 18;
    }

    function setOpenTrading(bool _open) external onlyOwner{
        openTrading = _open;
    }

    function burnFrom(address account, uint256 amount) public virtual {
        _spendAllowance(account, _msgSender(), amount);
        _burn(account, amount);
    }

    function burn(uint256 amount) public virtual {
        _burn(_msgSender(), amount);
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(!isBlackListed[from] && !isBlackListed[to],"UP:Blacklisted");

        if(!openTrading && (to == address(uuPair) || from == address(uuPair)) ){
            require(whitelisted[from] || whitelisted[to],"market closed");
        }

        //记录twap价格
        if(from != address(0) && balanceOf(address(uuPair)) > 0){
            _update();
        }               
    }

    function twapLen() external view returns (uint256){
        return twapTimes.length;
    }
    function _update() internal{
        (uint price0Cumulative, uint price1Cumulative,uint32 blockTimestamp) = currentCumulativePrices(address(uuPair));
      if(price0Cumulative > 0 && (twapTimes.length == 0 || block.timestamp/3600 > twapTimes[twapTimes.length-1]/3600 )) {
        
        twapTimes.push(blockTimestamp);
        if(address(this) == uuPair.token0()){
            usdtPriceCumulatives.push(price1Cumulative);
        }else{
            usdtPriceCumulatives.push(price0Cumulative);
        }
      }

      if(block.timestamp/(3600*24) > lastUpPriceDay){
        if(lastUpPriceDay>0 && lastUpPriceDay < block.timestamp/(3600*24) - 1){
            for(uint256 idx = lastUpPriceDay+1;idx<block.timestamp/(3600*24);idx++){
                usdtPrices[idx] = usdtPrices[idx-1];
            }
        }
        
        uint256 price = consult(24*3600,1e18, price0Cumulative, price1Cumulative);
        usdtPrices[block.timestamp/(3600*24)] = price;
        lastUpPriceDay = block.timestamp/(3600*24);

      }
    }

    function consult(uint256 _windowSize, uint256 amountIn, uint price0Cumulative, uint price1Cumulative) public view returns (uint256 amountOut){
        if(twapTimes.length < 2){
            (uint112 reserve0,uint112 reserve1,) = uuPair.getReserves();
            if(address(this) == uuPair.token0()){
                amountOut = uniswapV2Router.quote(amountIn, reserve1, reserve0);
            }else{
                amountOut = uniswapV2Router.quote(amountIn, reserve0,reserve1);
            }
        }else{   
            if(_windowSize < 3600) _windowSize = 3600;
            uint256 i= twapTimes.length - 1;
            for(;i>=1;i--){
                if(twapTimes[i] <  block.timestamp - _windowSize) break;
            }
            if(i == twapTimes.length - 1)i-=1;
            uint256 priceCumulativeStart = usdtPriceCumulatives[i+1];
            uint256 timeElapsed = block.timestamp - twapTimes[i+1];
            if(timeElapsed==0){
                timeElapsed = block.timestamp - twapTimes[i];
                priceCumulativeStart = usdtPriceCumulatives[i];
            }
            uint256 priceCumulativeEnd = price1Cumulative;
            if(address(this) == uuPair.token1()){
                priceCumulativeEnd = price0Cumulative;
                
            }
            amountOut = computeAmountOut(priceCumulativeStart, priceCumulativeEnd, timeElapsed, amountIn);
        }        
    }

    function computeAmountOut(
        uint priceCumulativeStart, uint priceCumulativeEnd,
        uint timeElapsed, uint amountIn
    ) private pure returns (uint amountOut) {

        uint224 priceAverage = uint224((priceCumulativeEnd - priceCumulativeStart) / timeElapsed);
        amountOut = uint144((priceAverage * amountIn) >> 112);
    }

    function getBlackListStatus(address _maker) external view returns (bool) {
        return isBlackListed[_maker];
    }
   
    
    function addBlackList (address _evilUser) public onlyOwner {
        isBlackListed[_evilUser] = true;
        emit AddedBlackList(_evilUser);
    }

    function removeBlackList (address _clearedUser) public onlyOwner {
        isBlackListed[_clearedUser] = false;
        emit RemovedBlackList(_clearedUser);
    }

    function twap(uint256 _windowsize, uint256 _amountIn) public view returns (uint256 amount_){
        (uint price0Cumulative, uint price1Cumulative,) = currentCumulativePrices(address(uuPair));
        amount_ = consult(_windowsize,_amountIn, price0Cumulative, price1Cumulative);
    }

    function currentBlockTimestamp() internal view returns (uint32) {
        return uint32(block.timestamp % 2 ** 32);
    }

    // produces the cumulative price using counterfactuals to save gas and avoid a call to sync.
    function currentCumulativePrices(
        address pair
    ) internal view returns (uint price0Cumulative, uint price1Cumulative, uint32 blockTimestamp) {
        blockTimestamp = currentBlockTimestamp();
        price0Cumulative = IUniswapV2Pair(pair).price0CumulativeLast();
        price1Cumulative = IUniswapV2Pair(pair).price1CumulativeLast();

        // if time has elapsed since the last update on the pair, mock the accumulated price values
        (uint112 reserve0, uint112 reserve1, uint32 blockTimestampLast) = IUniswapV2Pair(pair).getReserves();
        if (blockTimestampLast != blockTimestamp) {
            // subtraction overflow is desired
            uint32 timeElapsed = blockTimestamp - blockTimestampLast;

            price0Cumulative += uint(UQ112x112.encode(reserve1).uqdiv(reserve0)) * timeElapsed;
            price1Cumulative += uint(UQ112x112.encode(reserve0).uqdiv(reserve1)) * timeElapsed;
        }
    }

    function whitelistUser(address _user) public onlyOwner {
        whitelisted[_user] = true;
    }

    function removeWhitelistUser(address _user) public onlyOwner {
        whitelisted[_user] = false;
    }

}

