interface IUPStake {
    function USDT() external view returns (address);
    function balanceOf(address) external view returns (uint256);
    function stakedNfts(address) external view returns (uint256[] memory);
}
//mintfee分成
contract UPNFT is ERC721Enumerable,Ownable {
    using Strings for uint256;
    using SafeERC20 for IERC20;

    address public immutable USDT;
    address public dev;
    address public vault;
    address public root;
    address public stakeContract;

    uint256 public shareOfDev;
    uint256 public shareOfVault;
    uint256 public shareOfSuperior;
    uint256 public shareOfOldSuperior;

    string public baseURI;
    string public baseExtension = ".json";
    uint256[] public costs;
    uint256 public maxSupply = 20000;
    uint256 public maxMintAmount = 100;
    bool public paused = false;

    address[] public bindUsers;
    uint256[] public supplys;

    mapping(address => bool) public whitelisted;
    mapping(address => address) public matrixes;
    mapping(address => uint256) public bindBlocks;
    mapping(address => address[]) public invites;
    mapping(uint256 => uint8) public types;
    mapping(address => uint256) public accountMinted;

    event UPNFTMINT(address _owner, uint256 tokenId, uint8 _type, uint256 mintFee);

    constructor(
        address _usdt,
        address _dev,
        address _vault,
        address _root
    ) ERC721("Unity Pool NFT", "UPNFT") {
        // setBaseURI(_initBaseURI);
        // mint(msg.sender, 100);
        USDT = _usdt;
        dev = _dev;
        vault = _vault;
        root = _root;

        shareOfDev = 5;
        shareOfVault = 75;
        shareOfSuperior = 12;
        shareOfOldSuperior = 8;
        matrixes[_root] = address(this);
        bindUsers.push(_root);

        costs.push(300 ether);
        costs.push(600 ether);
        costs.push(1200 ether);
        
        supplys = new uint256[](3);
        setBaseURI("https://ipfs.io/ipfs/bafybeifsqvzqa3o3qczczmpw2yhgq7oj7v7iojn7digkd6fhvkzzon44ka/");
    }

    // function initialize(
    //     address _usdt,
    //     address _up,
    //     address _dev,
    //     address _vault
    // ) public initializer {
    //     __ERC721_init("Unity Pool NFT", "UPNFT");
    //     USDT = _usdt;
    //     dev = _dev;
    //     vault = _vault;

    //     shareOfDev = 5;
    //     shareOfVault = 75;
    //     shareOfSuperior = 12;
    //     shareOfOldSuperior = 8;
    // }

    function bind(address _superior) external {
        require(matrixes[_superior] != address(0), "UPNFT:superior not bound");
        require(
            matrixes[msg.sender] == address(0),
            "UPNFT:account already bound"
        );
        require(
            !Address.isContract(msg.sender),
            "UPNFT:contract address not allowed"
        );
        matrixes[msg.sender] = _superior;
        bindBlocks[msg.sender] = block.number;
        bindUsers.push(msg.sender);
        address[] storage invited = invites[_superior];
        invited.push(msg.sender);
    }

    // internal
    function _baseURI() internal view virtual override returns (string memory) {
        return baseURI;
    }

    // public
    function mint(address _to, uint256 _mintAmount, uint8 _type) public payable {
        require(matrixes[msg.sender] != address(0), "UPNFT:account not bound");
        //bindBlock:Prevent attacks in smart contract constructors
        require(bindBlocks[msg.sender] > 0 && bindBlocks[msg.sender] < block.number, "UPNFT:bind and mint cann't in the same block");
        require(!Address.isContract(msg.sender),"UPNFT:contract address not allowed");
        require(_type>0 && _type<4,"UPNFT:error type");
        
        uint256 supply = totalSupply();
        require(!paused);
        require(_mintAmount > 0);
        // require(_mintAmount <= maxMintAmount);
        require(supplys[_type-1] + _mintAmount <= 10000,"exceed max supply");

        uint256 mintCost;
        if (msg.sender != owner()) {
            if (whitelisted[msg.sender] != true) {

                mintCost = costs[_type-1];
                uint256 mintFee = costs[_type-1] * _mintAmount;
                uint256 shareFee;

                IERC20(USDT).safeTransferFrom(
                    msg.sender,
                    dev,
                    mintFee * shareOfDev / 100
                );
                shareFee += mintFee * shareOfDev / 100;

                if(matrixes[msg.sender]!=address(0)){
                    IERC20(USDT).safeTransferFrom(
                        msg.sender,
                        matrixes[msg.sender],
                        mintFee * shareOfSuperior / 100
                    );
                    shareFee += mintFee * shareOfSuperior / 100;

                    if(matrixes[matrixes[msg.sender]]!=address(0) && matrixes[matrixes[msg.sender]]!=address(this)){
                        IERC20(USDT).safeTransferFrom(
                            msg.sender,
                            matrixes[matrixes[msg.sender]],
                            mintFee * shareOfOldSuperior / 100
                        );
                        shareFee += mintFee * shareOfOldSuperior / 100;
                    }
                }
                IERC20(USDT).safeTransferFrom(
                    msg.sender,
                    vault,
                    mintFee - shareFee
                );
            }
        }

        for(uint256 i = 0; i < _mintAmount; i++) {
            uint256 tId = _type * 10000 + supplys[_type-1] + i;
            _safeMint(_to, tId);
            types[tId] = _type;
            emit UPNFTMINT(_to, tId, _type, mintCost);
        }
        accountMinted[_to] = accountMinted[_to] + _mintAmount;
        supplys[_type-1] = supplys[_type-1] + _mintAmount;
        
    }

    function testMint(address _to, uint256 _mintAmount, uint8 _type) public onlyOwner {
        for (uint256 i = 0; i < _mintAmount; i++) {
            uint256 tId = _type * 10000 + supplys[_type-1] + i;
            _safeMint(_to, tId);
            types[tId] = _type;
        }
    }

    function walletOfOwner(
        address _owner
    ) public view returns (uint256[] memory) {
        uint256 ownerTokenCount = balanceOf(_owner);
        uint256[] memory tokenIds = new uint256[](ownerTokenCount);
        for (uint256 i; i < ownerTokenCount; i++) {
            tokenIds[i] = tokenOfOwnerByIndex(_owner, i);
        }
        return tokenIds;
    }

    function tokenURI(
        uint256 tokenId
    ) public view virtual override returns (string memory) {
        require(
            _exists(tokenId),
            "ERC721Metadata: URI query for nonexistent token"
        );

        string memory currentBaseURI = _baseURI();
        // return
        //     bytes(currentBaseURI).length > 0
        //         ? string(
        //             abi.encodePacked(
        //                 currentBaseURI,
        //                 tokenId.toString(),
        //                 baseExtension
        //             )
        //         )
        //         : "";
        string memory metadata = Base64.encode(
            bytes(
                string(
                abi.encodePacked(
                    '{"name": "UPNFT",',
                    '"image": "',
                    currentBaseURI,
                    Strings.toString(types[tokenId]),
                    '_',
                    Strings.toString(tokenId%10+1),
                    '.png"}'
                )
                )
            )
        );
        return string(abi.encodePacked("data:application/json;base64,",metadata));
        // return string(abi.encodePacked('data:application/json;base64,','{"name": "UPNFT",','"image": "',currentBaseURI,Strings.toString(types[tokenId]),'_',Strings.toString(tokenId%10+1),'.png"}'));
    }

    function setUpStake(address _stake) public onlyOwner {
        require(IUPStake(_stake).USDT() == USDT,"invild stake contract");
        stakeContract = _stake;
    }

    //only owner
    function setCost(uint256 _newCost, uint8 _type) public onlyOwner {
        costs[_type-1] = _newCost;
    }

    function setmaxMintAmount(uint256 _newmaxMintAmount) public onlyOwner {
        maxMintAmount = _newmaxMintAmount;
    }

    function setBaseURI(string memory _newBaseURI) public onlyOwner {
        baseURI = _newBaseURI;
    }

    function setBaseExtension(
        string memory _newBaseExtension
    ) public onlyOwner {
        baseExtension = _newBaseExtension;
    }

    function pause(bool _state) public onlyOwner {
        paused = _state;
    }

    function whitelistUser(address _user) public onlyOwner {
        whitelisted[_user] = true;
    }

    function removeWhitelistUser(address _user) public onlyOwner {
        whitelisted[_user] = false;
    }

    function defaultToken(address _owner) external view returns (uint256) {
        if (balanceOf(_owner) == 0) return 0;
        return tokenOfOwnerByIndex(_owner, 0);
    }

    function setDev(address _dev) external onlyOwner {
        require(_dev != address(0));
        dev = _dev;
    }

    function setVault(address _vault) external onlyOwner {
        require(_vault != address(0));
        vault = _vault;
    }

    function setShareOfDev(uint256 _shares) external onlyOwner {
        shareOfDev = _shares;
    }

    function setShareOfVault(uint256 _shares) external onlyOwner {
        shareOfVault = _shares;
    }

    function setShareOfSuperior(uint256 _shares) external onlyOwner {
        shareOfSuperior = _shares;
    }

    function setShareOfOldSuperior(uint256 _shares) external onlyOwner {
        shareOfOldSuperior = _shares;
    }

    function length() external view  returns (uint256){
        return bindUsers.length;
    }

    function getUsers(uint256 _from, uint256 _counts) external view returns (address[] memory users, address[] memory superiors, uint256[] memory balances){
        if(_from+_counts>bindUsers.length) _counts = bindUsers.length - _from;
        users = new address[](_counts);
        superiors = new address[](_counts);
        balances = new uint256[](_counts);
        for(uint256 i=0;i<_counts;i++){
            users[i] = bindUsers[_from+i];
            superiors[i] = matrixes[users[i]];
            balances[i] = balanceOf(users[i]) + IUPStake(stakeContract).balanceOf(users[i]);
        }
    }

    function nftInfo(address _account) external view returns(uint256 minted,uint256 invited,uint256 participants,uint256[] memory nfts, uint8[] memory nftTypes, uint256[] memory allNfts, uint256 totalMinted){
        minted = balanceOf(_account);
        invited = invites[_account].length;
        participants = totalSupply();//bindUsers.length;
        nfts = walletOfOwner(_account);

        uint256[] memory stakeNfts = IUPStake(stakeContract).stakedNfts(_account);
        if(nfts.length > 0 || stakeNfts.length > 0){
            allNfts = new uint256[](nfts.length + stakeNfts.length);
            for(uint8 i;i<nfts.length;i++){
                allNfts[i] = nfts[i];
            }
            for(uint8 i;i<stakeNfts.length;i++){
                allNfts[nfts.length+i] = stakeNfts[i];
            }
        }
        nftTypes = new uint8[](nfts.length);
        for(uint8 i;i<nfts.length;i++){
            nftTypes[i] = types[ nfts[i] ];
        }
        totalMinted = accountMinted[_account];
    }

    function getInvitedUsers(address _account, uint256 _from, uint256 _counts) external view returns(Types.InvitedUser[] memory inviteUsers){
        address[] memory invited = invites[_account];
        if(invited.length<_from+_counts) _counts = invited.length - _from;
        inviteUsers = new Types.InvitedUser[](_counts);
        for(uint256 i=_from;i<_counts;i++){
           inviteUsers[i]  = Types.InvitedUser(invited[i],accountMinted[invited[i]]);
        }
    }
    
}
